import React from 'react'
import './Card.css';

function Cards(props) {
    const { CardData, onCardClick } = props;
    return (
        <div className="">
            <div className="card-item">
                <img src="../Img/CardImg/Card1.JPG" onClick={() => {onCardClick(CardData)}} />
                <div className="card-text">{CardData.title}</div>
             </div>
        </div>
    )
}

export default Cards
